import { Box, Typography } from "@mui/material";




const TotalPaymentView = ({ cartItems }) => {
    return (
        <Box>
            <Box>
                <Typography>PRICE DETAILS</Typography>
            </Box>
            <Box>
                <Typography>Price({cartItems.len})</Typography>
            </Box>
        </Box>
    )
}
export default TotalPaymentView;
